        <style>
            /* .canvas-container {
                display: none !important;
            } */
            .new-hidden-map .mapboxgl-canvas-container .mapboxgl-canvas {
                margin-left: 0px;
                margin-top: 0px;
                left: 0px;
                max-height: none;
            }
    
            #map_container {
                position: relative;
                top: 0px;
                left: 0px;
                display: none;
                z-index: 9;
            }
    
            #map_icon {
                position: absolute;
                top: 0px;
                left: 0px;
                cursor: move;
                opacity: 0.5;
            }
    
            #black-color,
            #red-color,
            #green-color {
                z-index: 1005;
                position: absolute;
                right: 5px;
                color: white;
            }
    
            #black-color {
                top: 10px;
                background-color: black;
            }
    
            #red-color {
                top: 35px;
                background-color: red;
            }
    
            #green-color {
                top: 60px;
                background-color: green;
            }
    
            .map-overlay.top {
                position: absolute;
                z-index: 54650;
            }
    
            .coordinates {
                background: rgba(0, 0, 0, 0.5);
                color: #fff;
                position: absolute;
                bottom: 40px;
                left: 10px;
                padding: 5px 10px;
                margin: 0;
                font-size: 11px;
                line-height: 18px;
                border-radius: 3px;
                display: none;
            }
    
            #map {
    
                top: 0;
                bottom: 0;
                position: relative;
    
            }
    
            button.mapboxgl-ctrl-icon.mapboxgl-export-control,
            button.mapboxgl-ctrl-attrib-button,
            .mapboxgl-ctrl-bottom-left {
                display: none !important;
            }
    
            .mapboxgl-ctrl-geocoder--input {
                border-radius: var(--bs-border-radius);
            }
    
            .mapboxgl-ctrl-geocoder--input:focus {
                color: var(--bs-body-color);
                background-color: var(--bs-body-bg);
                border-color: #86b7fe;
                outline: 0;
                box-shadow: 0 0 0 0.25rem rgba(13, 110, 253, .25);
            }
    
    
            .bottom-sheet-wrapper .backdrop {
                position: absolute;
                top: 0;
                left: 0;
                width: 32%;
                height: 100%;
                background: rgba(0, 0, 0, 0.6);
                transition: all 0.2s ease-in-out;
                opacity: 0;
                pointer-events: none;
                z-index: 5;
                display: none;
    
            }
    
            .bottom-sheet-wrapper .bottom-sheet {
                background: #fff;
                width: 30%;
                position: absolute;
                z-index: 6;
                border-radius: 15px;
                transition: all 0.2s ease-in-out;
                /* left: 16%; */
                transform: translateX(-50%);
                bottom: -138%;
                display: block;
                top: 10px;
                padding: 30px;
                right: -516px;
            }
            .bottom-sheet-wrapper.show-modal .backdrop {
                opacity: 1;
                pointer-events: all;
            }
    
            .bottom-sheet-wrapper.show-modal .bottom-sheet {
                bottom: 10px;
                display: none;
            }
    
            .close {
                position: relative;
                width: 20px;
                height: 20px;
                float: right;
                margin: 10px;
                cursor: pointer;
            }
    
            .close span {
                display: block;
                width: 100%;
                height: 2px;
                border-radius: 2px;
                background: red;
                transform: rotate(45deg);
            }
    
            .close span::before {
                content: "";
                position: absolute;
                width: 100%;
                height: 2px;
                border-radius: 2px;
                background: red;
                transform: rotate(90deg);
            }
    
            #map_img_cont {
                width: 100%
            }
    
            #map_img_cont img {
                width: 100%;
            }
    
            .mapboxgl-ctrl-top-right {
                display: none;
            }
    
            @media screen and (max-width: 576px) {
                .bottom-sheet-wrapper .bottom-sheet {
                    width: 84%;
                    left: 49%;
                }
    
                .bottom-sheet-wrapper .backdrop {
                    width: 100%;
                }
    
            }
            .card button {
                border: none;
                outline: 0;
                padding: 12px;
                color: white;
                background-color: #000;
                text-align: center;
                cursor: pointer;
                width: 40%;
                font-size: 18px;
                position: absolute;
                bottom: 0;
                right: 0;
    
            }

            /* .bottom {
  position: fixed;
  top: 88%;
  left: 40% !important;
  transform: translate(-50%, -50%);
  text-align: center;
} */

        </style>
